// frontend/src/App.js
import React from 'react';
import './App.css'; // App 컴포넌트에 적용될 기본 CSS (나중에 기존 CSS로 대체하거나 병합)
// import './mystyles.css'; // 만약 기존 CSS 파일 이름이 mystyles.css 라면 이렇게 불러옵니다.

function App() {
  return (
    <div className="container"> {/* 전체 페이지를 감싸는 컨테이너 */}
      <header className="header">
        <h1>나의 모의고사 웹사이트</h1>
        <nav className="navigation">
          <ul>
            <li><a href="/">홈</a></li>
            <li><a href="/tests">모의고사 목록</a></li>
            <li><a href="/login">로그인</a></li>
          </ul>
        </nav>
      </header>

      <main className="main-content">
        {/* 이 부분에 각 페이지의 실제 내용이 들어갑니다. */}
        {/* 처음에는 간단한 환영 메시지만 넣어봅니다. */}
        <h2>환영한다! 지옥에 온것을</h2>
        <p>모의고사를 풀어 보라능</p>
      </main>

      <footer className="footer">
        <p>&copy; 2025 모든것은 고래봉의 것이다.</p>
      </footer>
    </div>
  );
}

export default App;
